VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'ent, with lower cerebral blood-flow velocity (a marker for decreased CBF) observed in this subgroup. This leads us to consider how we might best approach the treatment of stroke patients who are currently receiving CGRP-targeted therapies. It seems prudent to suggest that treatment with CGRP pathway mAbs or gepants should be paused immediately. After (ischemic) stroke, the reintroduction of CGRP pathway–targeted therapies may be reconsidered after a thorough evaluation of the potential benefits and harms in each individual patient. Establishing a precise time frame for discontinuing CGRP pathway–targeting drugs after stroke is challenging because poststroke remodeling is an individual and dynamic process. Motor recovery after stroke typically occurs within the first 3 months, whereas other remodeling processes can last up to 1 year.', '{0.3816014528274536,0.488433301448822,0.07499203830957413,-0.5987971425056458,-0.13571611046791077,-0.682708740234375,0.1757138967514038,-0.22367095947265625,-0.14937780797481537,-0.4615503251552582,-0.6260514259338379,0.04219045490026474,-0.39936158061027527,-0.2039550244808197,-0.040743064135313034,-0.5714856386184692,-0.058717016130685806,-0.2738495469093323,-0.04756553843617439,0.12284532934427261,-0.6242712736129761,-0.01566311903297901,0.3594936728477478,-0.1637827754020691,0.42446038126945496,-0.09645720571279526,0.07257241755723953,0.02227708511054516,0.6093697547912598,0.08475006371736526,-0.4103453755378723,0.7585431933403015,0.3010125756263733,-0.42533814907073975,-0.6276965141296387,0.07320699095726013,-0.16568385064601898,0.9062033295631409,0.20328572392463684,-0.5801793932914734,0.8215399980545044,1.105247139930725,-0.2559944689273834,-0.21373425424098969,0.26683923602104187,9.067878272617236e-05,-0.7851592898368835,0.40875643491744995,0.061718910932540894,0.11039217561483383,-0.22132164239883423,-0.45944616198539734,-0.584270715713501,0.18784390389