VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'ypically occurs within the first 3 months, whereas other remodeling processes can last up to 1 year. Based on existing data, it can be assumed that patients aged 65 years or younger without relevant CVD will not exhibit an increased risk of stroke due to CGRP-interfering drugs per se. This assumption is based on > 10,000 patients in phase 1–3 RCTs, postmarketing studies, long-term observational studies, and large migraine registries. However, as society in industrialized countries ages, an increasing number of people with migraine will face CVD. Various tools, such as the atherosclerotic CVD (ASCVD) score, have been developed to estimate a patient''s risk of experiencing a CV event within the next 10 years. This score considers factors such as age;

