INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 14, 'e treatment, only a handful of studies exist evaluating the efficacy and safety of this combination. Erenumab or galcanezumab for preventive use and ubrogepant for acute use were evaluated in an open-label label study with a follow-up of 45 days with no reported CV concerns. In summary, CGRP has been found to play a profound role in migraine pathogenesis but also covers beneficial tissue-protecting roles in CVD, especially in stroke. Current data of large RCTs do not suggest any elevation in stroke risk per se;

INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 15, 'os: In patients with acute stroke or SAH, all CGRP-targeted treatments should be paused immediately. Reinitiation of CGRP-targeted treatment needs to be evaluated particularly by the patients'' stroke etiology and other CV comorbidities. A treatment pause of a minimum of 3 months needs to be respected, and patients with small vessel disease should not undergo CGRP-targeted treatment. In older patients with preexisting CV comorbidities, traditional migraine preventives (e.g., beta-blockers) should be preferred. If CGRP-targeted treatment is still considered, gepants should be preferred because of their shorter half-life. mAbs or gepants should not be used in patients with small vessel disease or RP at all.', '{0.544555127620697,0.44197702407836914,0.06862566620111465,-0.5496137142181396,-0.058001261204481125,-0.0027928631752729416,0.4768439531326294,-0.2634066343307495,0.03421269729733467,-0.8966208696365356,-0.48605111241340637,0.7428341507911682,-0.09638068825006485,-0.42193445563316345,-0.048793867230415344,-0.052166834473609924,0.17674732208251953,0.10381661355495453,0.13154681026935577,0.05438941717147827,-0.7632133364677429,-0.13746269047260284,0.11513961106538773,0.11614666879177094,0.6168458461761475,0.11672181636095047,0.030049387365579605,0.05307305231690407,0.30330461263656616,0.039085645228624344,-0.5024617910385132,0.27153077721595764,0.24856224656105042,0.5502426028251648,-0.5244764685630798,-0.24861887097358704,-0.26256564259529114,1.0311427116394043,-0.4935898780822754,-0.5882433652877808,0.38060861825942993,1.37703275680542,-0.1788375973701477,-0.23332448303699493,0.14213904738426208,-0.10381628572940826,-0.964089035987854,0.7967026233673096,0.20860086381435394,0.049656644463539124,-0.37293291091918945,-0.20559272170066833,-0.5964260101318359,0.17897383868694305,-0.7232071161270142,-0.7419730424880981,0.2778221070766449,-0.3347359001636505,0.32431575655937195,-0.4229040443897247