VALUES ('A feasibility study on non-invasive and non-contact jugular venous pulse measurement using 60 GHz FMCW radar', 'The jugular venous pulse (JVP) reflects right atrial pressure and provides diagnostic insight into cardiovascular and pulmonary health. However, reliable assessment remains difficult due to neck adiposity, anatomical variability and suboptimal positioning. Although central venous catheterization is the gold standard, its invasive nature restricts routine or long-term use. This study introduces a non-invasive method for JVP estimation using a 60 GHz frequency-modulated continuous wave (FMCW) radar. The system captures venous pulsations at the skin surface and applies eigenbeamforming to enhance signal-to-noise ratio and pulse clarity. Radar parameters were optimized for signal fidelity and validated through morphological comparison with simultaneously recorded photoplethysmography (PPG) signals. Additionally, we compared radar-derived JVP signals with previously recorded catheterization data from a patient with early-stage heart failure to assess clinical relevance. Signal localization was successfully achieved within a direction-of-arrival (DoA) range of  Heart failure (HF) occurs when the heart is unable to pump the required amount of blood adequately to meet the demands of the entire body. This condition can arise because of either the heart’s inability to fill with an adequate blood volume or a weakened capacity to pump effectively. HF can potentially impair the functionality of vital organs, such as the brain, liver and kidneys. In Australia, approximately 15% of hospitalizations have been attributed to HF [ HF, also known as congestive heart failure (CHF), results in impaired blood pumping and venous congestion due to blood backing up into systemic and pulmonary veins. Right-sided HF is particularly associated with elevated venous pressure and gradual symptom onset, emphasizing the importance of right ventricular assessment. The jugular venous pulse (JVP) serves as a key indicator, offering insights into venous pressure and right heart abnormalities such as atrial fibrillation or tricuspid valve disorders [ As shown in  ( Traditional JVP estimation is invasive and limited mainly to critically ill patients in intensive or coronary care settings because of the high risk of complications. Traditionally, the IJV has been preferred for JVP assessment due to concerns that valves in the EJV may interfere with accurate measurements. However, this view is outdated. The IJV also contains valves that do not hinder pressure evaluation and may even enhance the visibility of venous waveforms by amplifying atrial pulsations, as noted by Steven McGee [ Non-invasive approaches for JVP estimation have explored PPG, though its reliability is often hindered by sensitivity to skin and tissue properties, which complicates calibration [ This study, for the first time, employs a 60 GHz frequency-modulated continuous wave (FMCW) radar for non-contact JVP assessment. The higher operating frequency provides enhanced spatial resolution and sensitivity to subtle surface displacements. The Infineon BGT60TR13C radar module was selected for its integrated antenna-in-package design, reduced interference susceptibility, and flexible parameter configuration. Furthermore, this work is the first to utilize the Sim4Life platform from ZMT Zurich MedTech AG to investigate the impact of RF electromagnetic fields on the neck region, specifically in the context of high-frequency radar for JVP monitoring. The key innovation lies in combining 60 GHz FMCW radar sensing with electromagnetic simulations to assess specific absorption rate (SAR) and power density (PD), supporting a safe and clinically applicable method for non-invasive JVP monitoring via the EJV. The most common and widely available method for measuring JVP is cannulation, an invasive technique considered the gold standard. In this procedure, an experienced anaesthesiologist inserts venous catheters into the right internal jugular or subclavian vein (SVC). These catheters are then connected to a multi-modular monitor via a pressure transducer. After zeroing the transducer to the heart level, the mean venous pressure (mm Hg) is displayed in real-time on the monitor and recorded as invasive venous pressure [ Invasive methods can lead to various complications related to vascular access and typically require trained and skilled physicians. Non-invasive techniques for JVP assessment are broadly categorized into intermittent and continuous methods. Continuous monitoring is particularly valuable for remote cardiac care. Several recent approaches employ pressure sensors, ultrasound, PPG and accelerometry. Ultrasound imaging of the IJV is the most established method, offering real-time clinical insights [ To address these limitations, García-López  Other modalities include accelerometer-based sensing, which captures skin vibrations linked to jugular and carotid flow [ In the broader context of PPG-based cardiovascular assessment, Elgendi  Non-invasive monitoring of the JVP has advanced through various contactless techniques. Amelard  Further innovations include Tang  Microwave radar technologies have also been explored. A prototype utilizing 24 GHz radar demonstrated the feasibility of JVP measurement;

