VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ded catheterization data from a patient with early-stage heart failure to assess clinical relevance. Signal localization was successfully achieved within a direction-of-arrival (DoA) range of  Heart failure (HF) occurs when the heart is unable to pump the required amount of blood adequately to meet the demands of the entire body. This condition can arise because of either the heart’s inability to fill with an adequate blood volume or a weakened capacity to pump effectively. HF can potentially impair the functionality of vital organs, such as the brain, liver and kidneys. In Australia, approximately 15% of hospitalizations have been attributed to HF [ HF, also known as congestive heart failure (CHF), results in impaired blood pumping and venous congestion due to blood backing up into systemic and pulmonary veins. Right-sided HF is particularly associated with elevated venous pressure and gradual symptom onset, emphasizing the importance of right ventricular assessment.', '{-0.11460547894239426,-0.23281215131282806,0.08177385479211807,-0.003234797390177846,0.18279649317264557,0.07912138104438782,0.3125131130218506,0.542030394077301,-1.1022204160690308,-0.7223809361457825,0.3743875324726105,0.5644726753234863,-0.04590558633208275,-0.16475889086723328,0.003189848270267248,-0.3113003671169281,0.5569885969161987,0.4662611186504364,0.3983391225337982,-0.6943418979644775,-1.0828322172164917,0.1748865395784378,-0.39237555861473083,0.18291854858398438,0.8299223184585571,0.04937343671917915,-0.2206050008535385,-0.33901703357696533,-0.16783197224140167,0.22940489649772644,-0.9656422734260559,-0.13676166534423828,-0.1935543268918991,-0.3480687439441681,-0.376530259847641,-0.5195335745811462,0.09427185356616974,-0.06113135442137718,-0.4385644793510437,-0.4637926518917084,-0.41234415769577026,-0.9046720266342163,-0.25070130825042725,-0.49262866377830505,0.2705112099647522,-0.36228376626968384,0.060413286089897