VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'ntenna-in-package design, reduced interference susceptibility, and flexible parameter configuration. Furthermore, this work is the first to utilize the Sim4Life platform from ZMT Zurich MedTech AG to investigate the impact of RF electromagnetic fields on the neck region, specifically in the context of high-frequency radar for JVP monitoring. The key innovation lies in combining 60 GHz FMCW radar sensing with electromagnetic simulations to assess specific absorption rate (SAR) and power density (PD), supporting a safe and clinically applicable method for non-invasive JVP monitoring via the EJV. The most common and widely available method for measuring JVP is cannulation, an invasive technique considered the gold standard. In this procedure, an experienced anaesthesiologist inserts venous catheters into the right internal jugular or subclavian vein (SVC). These catheters are then connected to a multi-modular monitor via a pressure transducer.', '{-0.11258981376886368,0.06554102152585983,-0.8979772329330444,-0.34068554639816284,-0.3366622030735016,0.0070585282519459724,-0.9351537227630615,-0.30962061882019043,0.09231700748205185,0.18569150567054749,-0.3158635199069977,-0.18221111595630646,0.22477944195270538,-0.25416266918182373,-0.6469528079032898,-0.12836046516895294,-0.24375395476818085,0.036904219537973404,0.016867879778146744,-0.14306366443634033,0.03378172591328621,-0.9218540787696838,0.14843939244747162,0.40296003222465515,1.4593896865844727,0.19960589706897736,1.0807366371154785,-0.05620259419083595,0.022648409008979797,-0.18197442591190338,-0.24500897526741028,0.05273985490202904,-0.9942485094070435,0.3186028003692627,-0.2478555142879486,-0.40431270003318787,0.21188433468341827,0.6921210885047913,0.03700872138142586,-0.0018561285687610507,-0.7321212887763977,-0.9175413250923157,0.02958376519382,-0.7089570164680481,-0.4006195068359375,-0.4860820770263672,-0.2472483515739441,-0.1727812588214