VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'cardiac care. Several recent approaches employ pressure sensors, ultrasound, PPG and accelerometry. Ultrasound imaging of the IJV is the most established method, offering real-time clinical insights [ To address these limitations, García-López  Other modalities include accelerometer-based sensing, which captures skin vibrations linked to jugular and carotid flow [ In the broader context of PPG-based cardiovascular assessment, Elgendi  Non-invasive monitoring of the JVP has advanced through various contactless techniques. Amelard  Further innovations include Tang  Microwave radar technologies have also been explored. A prototype utilizing 24 GHz radar demonstrated the feasibility of JVP measurement;

