VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'using high-frequency radar. The workflow for the detection of the JVP is described in this section. The data cube contains the normalized ADC samples of the received signal. Each frame of data consists of the number of receiving antennas ( Flowchart of the data processing sequence. After reshaping the raw data, an FFT is performed on the samples to obtain the range information. Upon computation of FFT, displacement is calculated from the phase variation, which is then used to extract the JVP. Below, we detail each step in the signal processing sequence, accompanied by the corresponding pseudo-codes. The raw data vector is first reshaped into a matrix. FFT processing was applied to every chirp pulse in each frame and to each antenna. (The optional windowing technique can be used before the FFT for spectrum interpolation.) The FFT outputs are averaged to reduce the noise effect for each antenna signal and from each frame.', '{-0.5713182687759399,0.22064803540706635,-1.21371328830719,-0.7402733564376831,-0.33239585161209106,-0.27436286211013794,-0.41998225450515747,0.1083465963602066,0.6226012110710144,0.26173168420791626,-0.4323555827140808,-0.24635735154151917,-0.3624975383281708,0.32937923073768616,-0.5212640166282654,-0.19156236946582794,0.1273684948682785,-0.03535785898566246,0.01821453496813774,-0.45762187242507935,0.4260989725589752,-0.8698251843452454,0.3569554388523102,-0.24241796135902405,1.439436912536621,0.2416904866695404,0.828481137752533,0.2644103467464447,-0.049077603965997696,0.6393325328826904,-0.1693705916404724,-0.2596144378185272,-1.0305832624435425,0.023540988564491272,-0.9473403692245483,-0.40781232714653015,0.3373556435108185,0.26663216948509216,0.42414286732673645,0.685227632522583,-0.5449792742729187,-0.38523760437965393,-0.1960633099079132,0.02973727136850357,0.25199201703071594,-0.7757881879806519,-0.3142909109592438,-0.19317443668842316,0.7154208421707153,0.20543822646