VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, 't in the environment. For reference, see electronic supplementary material, figure S8 in section S6. Our study explores a proof-of-concept technology for JVP detection using varying radar parameters, such as samples/chirp, chirps/frame and sampling frequency. Our findings, illustrated in  Detected JVP waveforms (red) overlaid on the full signal (blue);

