VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 17, 'es, the carotid pulse is expected to be more dominant compared with JVP, overshadowing its features. Analyses of JVP signal at both time ( Comparison of JVP and PPG signals from synchronized measurements, highlighting temporal alignment and amplitude differences between JVP and PPG pulsations. As a proof-of-concept feasibility study, the experiment was ethically limited to a healthy subject. While cardiac catheterization remains the gold standard for JVP assessment, it is invasive and typically reserved for critically ill patients. To provide comparative insight, we analysed RHC data from a patient with TR—an early marker of CHF, and compared its spectral characteristics with the JVP signal from our healthy subject. This comparison highlights waveform differences between normal and early-stage CHF conditions. In  Frequency spectrum comparison of RHC CVP signal and sensor recorded JVP signal.', '{0.028533736243844032,-0.36384648084640503,-0.6630898118019104,-0.4171099066734314,-0.16287089884281158,0.2559097111225128,-0.7431136965751648,-0.39664775133132935,0.582050085067749,-0.6005876064300537,-0.31284859776496887,0.0484260730445385,0.0123046999797225,-0.5007005333900452,-0.25091084837913513,-0.5485866069793701,0.30445703864097595,-0.16587167978286743,0.2287624329328537,-0.19794531166553497,-0.34780919551849365,-0.4937548041343689,0.08055593818426132,0.15696847438812256,1.1935412883758545,-0.14018364250659943,0.8016595840454102,0.4213913381099701,0.19333399832248688,0.10129265487194061,-0.09391812235116959,-0.1332474648952484,-0.4102703332901001,-0.24521614611148834,-0.2711363732814789,-0.3562965393066406,-0.2315545678138733,0.22914686799049377,0.37041547894477844,-0.536932110786438,-0.34399715065956116,-0.4588049054145813,0.2733118236064911,0.005421760026365519,0.1774045079946518,-0.04670168086886406,0.24268074333667755,0.036642905324697495,0.058046020567417145,-0.14061075448989868,-0.099473401