VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 19, 'his study demonstrates the feasibility of using a 60 GHz FMCW radar for non-invasive JVP extraction. The radar’s high resolution, integrated antenna design and sensitivity to subtle skin displacements make it well-suited for detecting venous pulsations. All recordings utilized the maximum bandwidth of 5.5 GHz in close-range measurements. JVP signal quality was found to depend on radar–subject distance. Too close a placement caused overlap between the initial reflection and the DC component in the FFT spectrum, while excessive distance diminished signal amplitude. An optimal spacing of approximately 2 mm was maintained. Additionally, inter-bin mixing effects and hardware constraints—particularly the tight coupling between sampling frequency and chirp configuration—necessitated precise tuning of system parameters. At least eight chirps were required to reliably extract phase information due to the radar’s fast chirp generation characteristics.', '{-0.24676701426506042,-0.3035045266151428,-1.247512698173523,-0.6097780466079712,0.005879973992705345,0.06184830516576767,-0.9438066482543945,0.019320713356137276,0.6922295093536377,-0.08915695548057556,-0.2535874545574188,-0.33838140964508057,-0.18581902980804443,-0.08987355977296829,-0.4156891703605652,-0.3191153407096863,-0.7821789979934692,-0.2632109522819519,0.6863351464271545,0.1421320140361786,-0.20890101790428162,-0.895362913608551,0.22977210581302643,0.09343617409467697,1.675770878791809,0.08306609094142914,0.4071234166622162,-0.01368990819901228,-0.08261369913816452,0.03939710557460785,0.13184447586536407,-0.3209918141365051,-1.6712530851364136,-0.27996113896369934,-0.8127566576004028,-0.41833245754241943,0.4879152476787567,0.5202944278717041,0.5439389944076538,0.43485817313194275,-0.9122416377067566,-0.13895238935947418,-0.025207670405507088,-0.5438318848609924,-0.3344835042953491,-0.22278663516044617,-0.21262764930725098,-0.24045094847679138,