VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 'ired to reliably extract phase information due to the radar’s fast chirp generation characteristics. These findings highlight the potential of high-frequency radar for integration into non-contact clinical monitoring systems, offering a promising alternative to invasive techniques for early cardiovascular assessment. Through meticulous evaluation, we established the subsequent configuration for JVP estimation with this radar: Higher sampling rate for a fast time (higher number of samples per chirp) to increase FFT-range resolution. Because a lower value implies a reduction of the signal quality and even burying the signal in noise. Suppress averaging on FFT-range spectrums over all chirps to avoid losing JVP signal details. Higher frame rate to get more time resolution for JVP signal. In some situations, a signal with low SNR in one antenna can significantly reduce the performance of the beamformer and, eventually, the pulse detection.', '{-0.5042526125907898,-0.3249182403087616,-1.2076044082641602,-0.7291674613952637,0.0703434869647026,0.1679229587316513,-0.7442519068717957,-0.19487884640693665,0.6746423840522766,0.20081213116645813,-0.49792471528053284,-0.018506037071347237,-0.2768121063709259,0.3410353660583496,-0.32254132628440857,-0.27033352851867676,-0.64503413438797,-0.3566719889640808,0.20224598050117493,-0.2478933334350586,0.16710004210472107,-0.914786159992218,0.2902805507183075,-0.05837121233344078,1.3619900941848755,-0.008994540199637413,0.7949292659759521,0.30287986993789673,0.005239915568381548,0.22149239480495453,0.004407264292240143,-0.043464697897434235,-1.1843985319137573,-0.38163697719573975,-0.7988836169242859,-0.28223878145217896,0.5177578330039978,0.3662264347076416,0.4708077907562256,0.5080723166465759,-0.2731170952320099,-0.025810711085796356,0.18430787324905396,-0.626460611820221,0.11987243592739105,-0.5940496325492859,-0.05419235676527023,-0.1715843677520752,0.15512414