VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 22, 't. Applying a Fourier transform yields complex I/Q data, enabling phase analysis across frequencies. However, this architecture is susceptible to signal fading caused by phase offsets between the reference and reflected signals, limiting its temporal accuracy compared with true I/Q radar systems. Through the configuration illustrated in  The original beat signal exhibits a pronounced spike thanks to its high amplitude. By contrast, radar-based beat reconstruction reveals an inconsistent envelope signal stemming from the phase difference between the received signal and the local oscillator. This experiment not only confirms the effectiveness of our algorithm but also sheds light on the constraints related to the hardware (see electronic supplementary material S6, figure S9). Therefore, we prefer to use a sensor equipped with an IQ mixer for future experiments. JVP signals are often obscured by dominant arterial or respiratory components, complicating their isolation and analysis.', '{0.015315401367843151,-0.14507748186588287,-1.0405018329620361,-0.5206891894340515,0.09987154603004456,0.24395056068897247,-0.6399925947189331,0.037990961223840714,0.838789701461792,-0.07754166424274445,-0.31109386682510376,0.09723605215549469,-0.14016741514205933,-0.02659125253558159,-0.425339013338089,-0.34855180978775024,-0.4342101812362671,-0.11957541108131409,0.007165681105107069,-0.09425494074821472,0.12173288315534592,-1.1323567628860474,0.3081233501434326,-0.12041138112545013,1.355002522468567,0.20199795067310333,0.8914180994033813,0.23289978504180908,0.093836709856987,0.16957733035087585,-0.07265061885118484,-0.31732597947120667,-1.0362212657928467,-0.04856574535369873,-0.5633091926574707,-0.20649230480194092,0.3261887729167938,0.7755193710327148,0.2934266924858093,0.23726442456245422,-0.4576280117034912,-0.2660626173019409,-0.07893349975347519,-0.07905562222003937,-0.005684725474566221,-0.9506822228431702,-