VALUES ('Laparoscopic treatment of giant ovarian cystic tumors in children: Case report', 'Ovarian cystic tumors are common in adult women. However, cases of ovarian cystic tumors approximately 30 cm in diameter are rarely reported in adult women and even rarer in children. Here, we report a rare case of a giant ovarian cystic tumor in a 13-year-old girl. A 13-year-old girl was admitted to hospital with abdominal pain and distension for 7 days. The parents felt anxious about the child’s abdominal lesions and requested laparoscopic surgery. After evaluation at our hospital, abdominal color ultrasound and enhanced computer tomography revealed a large sac-like fluid density shadow with clear edges in the abdomen, approximately 38 cm × 35 cm × 24 cm in size. We performed a laparoscopic resection of the cystic ovarian tumor, which was pathologically confirmed as a benign ovarian tumor. Subsequently, laparoscopic exploration revealed a huge cystic tumor originated from the right ovary with a clear boundary between the tumor and the right ovary. Laparoscopic surgery was used to remove the lesion, and the postoperative recovery and follow-up were uneventful. Cases of ovarian cystic tumors with a diameter of approximately 30 cm are very rare in pediatric patients. Laparoscopic surgery is an essential method for the diagnosis and treatment of giant ovarian cystic tumors and can be used as a first-line treatment. Ovarian cysts are approximately 14% more common in women of reproductive age The patient weighed 124 kg and was 153 cm tall. Vital signs included a heart rate of 121 beats/min, breathing 25 minutes, and blood pressure 141/82 mm Hg. Routine blood tests, including liver, kidney, and coagulation functions were within the normal range. She was admitted with abdominal pain with bloating for 7 days. The abdominal pain was tolerable, with no nausea, vomiting, and her temperature was normal. The parents observed that the abdominal distention of the patient was more evident than that of her twin sister;

