VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'c tumor originated from the right ovary with a clear boundary between the tumor and the right ovary. Laparoscopic surgery was used to remove the lesion, and the postoperative recovery and follow-up were uneventful. Cases of ovarian cystic tumors with a diameter of approximately 30 cm are very rare in pediatric patients. Laparoscopic surgery is an essential method for the diagnosis and treatment of giant ovarian cystic tumors and can be used as a first-line treatment. Ovarian cysts are approximately 14% more common in women of reproductive age The patient weighed 124 kg and was 153 cm tall. Vital signs included a heart rate of 121 beats/min, breathing 25 minutes, and blood pressure 141/82 mm Hg. Routine blood tests, including liver, kidney, and coagulation functions were within the normal range. She was admitted with abdominal pain with bloating for 7 days. The abdominal pain was tolerable, with no nausea, vomiting, and her temperature was normal.', '{0.09175907075405121,0.09593936800956726,-0.10309691727161407,0.16502586007118225,-0.8844988942146301,0.17279522120952606,-0.10298264026641846,-0.38785845041275024,-0.316900372505188,0.22999007999897003,0.02751140110194683,0.8315032124519348,-0.4716590940952301,-0.1729182004928589,0.13010942935943604,-0.006980699487030506,-1.4337100982666016,0.1968860924243927,1.1539280414581299,-0.6929596662521362,-0.16547730565071106,-0.5824024677276611,-0.5838751792907715,0.918648898601532,0.2647086977958679,0.3729586601257324,-0.31537318229675293,-0.23998405039310455,-1.294334053993225,-0.49285897612571716,-0.7890603542327881,0.1604999303817749,0.3421039581298828,-0.002634246600791812,-0.08824098855257034,0.07791054993867874,0.42499563097953796,0.6693642139434814,-1.2394942045211792,0.04889202117919922,-0.9736427068710327,-0.3389343321323395,-0.045808203518390656,-0.17001746594905853,0.4639783203601837,0.44827648997306824,0.10785024613142014,0.6599687933921814,-0