VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'considered in the differential diagnosis of large cystic tumors in the abdominal cavity of children. Ovarian cyst treatment can be divided into conservative and surgical treatments. Most ovarian cysts are treated conservatively with observation. Ovarian cysts: commonly have a diameter >5 cm, tend to be malignant, and ovarian cyst torsion and other symptoms require surgical treatment. Cases of giant ovarian cystic tumors approximately 30 cm in diameter in children are rare. Complete laparoscopic resection of the tumor was successful. The patient recovered smoothly after surgery, and no recurrence was observed during 1-year follow-up. We hope our report provides clinicians with ideas for diagnosis and treatment to provide better medical care to children. We would like to thank Editage (', '{-0.2482466995716095,0.06743216514587402,0.10458356142044067,-0.34475937485694885,-0.8750389814376831,-0.024886449798941612,-0.14053691923618317,-0.5556119084358215,-0.18115338683128357,0.7459583878517151,-0.002257011830806732,1.1672419309616089,-0.24412553012371063,-0.07344269752502441,-0.21338939666748047,0.04308604449033737,-1.0108221769332886,0.0739399641752243,0.8674612045288086,-0.25991109013557434,-0.26190799474716187,-0.6214599609375,-0.46459144353866577,0.7272065877914429,0.09825240075588226,-0.008054420351982117,-0.5950837731361389,0.07274080067873001,-1.1638214588165283,-0.7497283816337585,-0.4874332547187805,0.2897201478481293,0.7908287048339844,-0.311906635761261,-0.02395453304052353,0.10445951670408249,0.28083568811416626,0.2884925305843353,-0.7449668645858765,-0.039424315094947815,-0.5685418248176575,0.2290503829717636,-0.26403144001960754,0.020739490166306496,0.2626366913318634,0.003818144090473652,-0.0841161385178566,0.5244078040122986,-0.19110903143882751,-0.12766659259796143,-0.5430658459663391,0.23448283970355988,0.06047167629003525,0.2552943825721741,-0.06955740600824356,-0.3277915120124817,