VALUES ('Molecular insights into gender-specific differences in rheumatoid arthritis: A study using high-throughput sequencing and Mendelian randomization', 'Rheumatoid arthritis (RA) is a multifaceted autoimmune disorder with notable gender differences. The impact of gender-specific genetic variations on RA’s pathogenesis remains unclear. This research investigates gender-specific genes in RA using Mendelian randomization (MR) and transcriptome sequencing to understand RA mechanisms, focusing on gender-specific immune responses. We used the limma package to analyze gender-differential genes in RA patients, followed by Gene Ontology (GO) and Kyoto Encyclopedia of Genes and Genomes analyses. Key genes were identified through least absolute shrinkage and selection operator and support vector machine recursive feature elimination, and a diagnostic nomogram was constructed and validated using the gene expression omnibus database. Immune cell and function analyses were performed using single-sample gene set enrichment analysis, and a competing endogenous ribonucleic acid (RNA) network was constructed. MR analysis was used to investigate the causal relationship between gender-differential genes and RA. Thirty differentially expressed genes were identified, with Gene Ontology analysis indicating their involvement in neutrophil-mediated killing. Six key genes (MAP7D2, AR, DNAH6, CXorf36, ORM1, and IQGAP3) were identified, and a diagnostic nomogram was developed (area under the curve: 0.956 in the training set, 0.859 in the validation set  Gender-specific differences in RA: The study identifies significant gender-specific genetic variations in rheumatoid arthritis, with a focus on how these differences influence immune responses. Key gene identification and diagnostic tool: Six key genes (MAP7D2, AR, DNAH6, CXorf36, ORM1, and IQGAP3) were identified as crucial, leading to the development and validation of a diagnostic nomogram with high accuracy. Immune cell analysis: Female RA patients were found to have lower levels of macrophages and neutrophils, highlighting gender-based differences in immune cell function. Mendelian randomization insights: The study used MR analysis to uncover the specific role of the RETN gene in seronegative RA patients, particularly in females. Clinical implications: The findings provide a foundation for developing personalized treatment strategies tailored to the gender-specific mechanisms of RA. Rheumatoid arthritis (RA) is a chronic autoimmune disorder characterized by persistent joint inflammation, leading to pain, functional disability, and systemic complications such as cardiovascular disease, pulmonary fibrosis, and osteoporosis. These manifestations significantly impair patients’ quality of life and survival, with China facing a substantial disease burden of approximately 5 million cases. A striking feature of RA is its pronounced gender disparity: women exhibit a threefold higher incidence than men and often experience more aggressive disease progression. This discrepancy strongly implicates sex-specific biological mechanisms in RA pathogenesis. Recent advances highlight multifaceted interactions between sex hormones, genetic susceptibility, and immune regulation. Estrogen has been shown to amplify Th17-mediated pro-inflammatory responses via ER-α signaling, while androgens like testosterone suppress autoantibody production by promoting Treg differentiation. Current therapies, including conventional disease-modifying antirheumatic drugs and biologics, have improved symptom control but remain limited by variable efficacy, adverse effects (e.g., hepatotoxicity, infections), and a lack of gender-specific treatment guidelines. To bridge this gap, Mendelian randomization (MR) offers a promising solution. As a genetic epidemiology method, MR uses genetic variants as instrumental variables (IVs) to infer causal relationships, minimizing confounding and reverse causality. In addition, the heterogeneity in clinical outcomes, adverse events, and drug responses between male and female RA patients further underscores the need for sex-aware research strategies. Therefore, this study seeks to systematically explore the sex-specific molecular mechanisms of RA by integrating MR and transcriptomics. We aim to identify RA-related genetic variants with sex-differential effects, detect differentially expressed genes (DEGs) between male and female patients and controls, and construct a sex-specific regulatory network. This integrative approach aspires to enhance our understanding of RA pathogenesis from a gendered perspective and contribute to the development of personalized treatment strategies, ultimately advancing precision medicine in RA. The workflow of this study was illustrated in Figure  Flowchart of this study. ceRNA = competing endogenous ribonucleic acid, DEGs = differentially expressed genes, GEO = gene expression omnibus, GO = Gene Ontology, KEGG = Kyoto Encyclopedia of Genes and Genomes, MR = Mendelian randomization, PBMCs = peripheral blood mononuclear cells, RA = rheumatoid arthritis. The recruitment period for this study began on 16-07-2021 and ended on 31-12-2022. We selected a total of 152 patients with RA who were admitted to the Department of Rheumatology and Immunology at Dazhou Central Hospital from July 2021 to December 2022 as the RA group. There were 123 female patients and 29 male patients. The study protocol, approved by the Ethics Committee of Dazhou Central Hospital (approval number: 2021-022), ensured the ethical conduct of the research. All participants voluntarily took part in the study and provided informed consent. Each participant signed a written consent form. This study adhered to the principles of the Declaration of Helsinki. All methods were conducted in strict compliance with relevant guidelines and regulations. Patients who met the diagnostic criteria for RA according to either the 1987 American College of Rheumatology or the 2010 American College of Rheumatology/European League Against Rheumatism guidelines were included. The age of the participants was ≥18 years, irrespective of gender. Patients with acute or chronic infectious diseases, patients with significant medical conditions affecting the heart, brain, liver, kidney, or blood, patients with malignant tumors or mental disorders, and pregnant or lactating women were excluded. Upon enrollment, a fasting venous blood sample (2.0–3.0 mL) was collected from participants in the RA group. Peripheral blood mononuclear cells were then isolated from these samples. RNA was extracted using TRIzol Reagent (Sangon Biotech, Shanghai, China) and assessed for quantity and quality with an Agilent 2100 Bioanalyzer (Agilent Technologies, Shanghai, China) to meet analysis standards. The RNA sample preparation involved purifying mRNA from total RNA using poly-T magnetic beads, fragmenting it with elevated temperatures and divalent cations, synthesizing 1st strand cDNA with random hexamer primers and M-MuLV Reverse Transcriptase, degrading RNA with RNase H, synthesizing 2nd strand cDNA with DNA polymerase I and dNTPs, smoothing DNA fragment ends, adenylating 3′ ends, ligating hairpin loop adaptors, isolating cDNA fragments of 370 to 420 bp via AMPure XP (Beckman Coulter, Beverly), and purifying amplified products to construct the sequencing library. The library, once qualified, was pooled according to effective concentration and desired sequencing volume, then sequenced on the Illumina NovaSeq 6000 platform. This process generated paired-end reads of 150 bp. The data underwent initial quality checks to ensure suitability for downstream analytical processes. The RA datasets ( We compared gene expression between female and male cohorts using our sequencing data. Differential genes were identified using the “limma” R package (version 3.40.6), applying a threshold of |log2 fold change| > 1 and a false discovery rate < 0.05. We visualized the results with volcano plots and heatmaps, employing the “ggplot2” and “pheatmap” R packages, respectively. We used the Kyoto Encyclopedia of Genes and Genomes REST API ( This study employed a dual strategy combining least absolute shrinkage and selection operator (LASSO) regression and support vector machine recursive feature elimination (SVM-RFE) to select gender-associated key genes. In the data preprocessing phase, clinical gender labels were integrated with differential expression data based on sample IDs to construct a standardized expression matrix (Z-score normalization). LASSO regression was implemented using the glmnet package (v4.1-8), with the elastic net parameter set to α = 1 (pure L1 penalty). The regularization path spanned λ = 10⁻⁵ to 10² over 100 logarithmic intervals. Ten-fold stratified cross-validation was used to determine the optimal penalty coefficient (λ.min = 0.008) and to extract the nonzero coefficient genes. SVM-RFE, implemented using the e1071 and msvmRFE packages, After identifying 6 pivotal genes (MAP7D2, AR, DNAH6, CXorf36, ORM1, IQGAP3), logistic regression analysis was conducted to construct a nomogram model, employing the “rms” R package. The diagnostic efficacy of these 6 hub genes was appraised by plotting the ROC curve, utilizing the “ ROCR” R package. The validation of the diagnostic model, predicated on the 6 hub genes, was conducted using the  The infiltration scores of 16 immune cells and the activity levels of 13 immune functions in both female and male RA groups were determined using single-sample gene set enrichment analysis (ssGSEA) through the “gsva” package in R. These scores were subsequently visualized using heatmaps created with the “pheatmap” package. Interacting miRNAs linked to key DEGs were identified utilizing StarBase ( In this study, we employed single nucleotide polymorphisms (SNPs) as IVs to investigate the causal relationship between 30DEGs as the exposure and RA as the outcome. The validity of the MR analysis hinges on 3 assumptions Detailed information on data sources in Mendelian randomization analysis. GWAs = genome-wide association studies, RA = rheumatoid arthritis, SNPs = single nucleotide polymorphism. Expression levels of DEGs in female and male. (A) Volcano plot of the DEGs;

