VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'life and survival, with China facing a substantial disease burden of approximately 5 million cases. A striking feature of RA is its pronounced gender disparity: women exhibit a threefold higher incidence than men and often experience more aggressive disease progression. This discrepancy strongly implicates sex-specific biological mechanisms in RA pathogenesis. Recent advances highlight multifaceted interactions between sex hormones, genetic susceptibility, and immune regulation. Estrogen has been shown to amplify Th17-mediated pro-inflammatory responses via ER-α signaling, while androgens like testosterone suppress autoantibody production by promoting Treg differentiation. Current therapies, including conventional disease-modifying antirheumatic drugs and biologics, have improved symptom control but remain limited by variable efficacy, adverse effects (e.g., hepatotoxicity, infections), and a lack of gender-specific treatment guidelines.', '{1.0544118881225586,0.1083875522017479,0.7799535989761353,-0.2781461179256439,-0.9072011113166809,0.5548567175865173,0.2072368562221527,0.7723391652107239,-0.26138049364089966,-0.41824576258659363,-0.08959853649139404,0.15836647152900696,-0.02716081589460373,-0.15295085310935974,0.1174941435456276,0.2488642930984497,1.180138111114502,0.03488527238368988,0.7257294058799744,-0.0969129428267479,-0.5275387167930603,0.14030909538269043,-1.0324139595031738,-0.41911882162094116,-0.7406196594238281,-1.0212931632995605,-0.5937879681587219,0.4136029779911041,-0.14595696330070496,-0.5750297904014587,-0.05038902163505554,1.0197279453277588,-0.19503186643123627,0.3343195915222168,-0.47799399495124817,0.12397252768278122,0.3611464500427246,0.41272011399269104,-0.4434245228767395,0.19530892372131348,0.15687718987464905,0.3317025601863861,0.18860359489917755,-0.15258370339870453,-0.4312991499900818,0.25536561012268066,0.395016610622406,-0.09531008452177048,-0.167961806058883