VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'erse effects (e.g., hepatotoxicity, infections), and a lack of gender-specific treatment guidelines. To bridge this gap, Mendelian randomization (MR) offers a promising solution. As a genetic epidemiology method, MR uses genetic variants as instrumental variables (IVs) to infer causal relationships, minimizing confounding and reverse causality. In addition, the heterogeneity in clinical outcomes, adverse events, and drug responses between male and female RA patients further underscores the need for sex-aware research strategies. Therefore, this study seeks to systematically explore the sex-specific molecular mechanisms of RA by integrating MR and transcriptomics. We aim to identify RA-related genetic variants with sex-differential effects, detect differentially expressed genes (DEGs) between male and female patients and controls, and construct a sex-specific regulatory network.', '{0.9447600841522217,0.055855363607406616,0.425125390291214,-0.019832540303468704,-0.08103501796722412,0.05866481363773346,0.3387957513332367,-0.009227539412677288,-0.26891660690307617,-0.6219893097877502,-0.39877280592918396,0.39764347672462463,-0.0027088643983006477,-0.202747642993927,-0.28234511613845825,0.3758612871170044,0.9262567758560181,-0.1917695552110672,0.47290468215942383,-0.14832469820976257,-0.12483725696802139,-0.2970147430896759,-0.5314883589744568,-0.29066839814186096,-0.42597126960754395,-0.7364862561225891,-0.18870626389980316,0.9686258435249329,0.12900815904140472,-0.07076647132635117,0.5805985331535339,0.948584258556366,-0.12074078619480133,-0.2932741641998291,0.045531220734119415,-0.15901125967502594,-0.4553709924221039,0.02815050631761551,-0.2922571003437042,-0.31643518805503845,-0.04472551867365837,0.3522329032421112,0.4345356822013855,-0.18739517033100128,-0.5887689590454102,-0.3871712386608124,-0.0548970028758049,-0.2633599638938904,-0.5311997532844543,0.2724318504333496,0.027743328362703323,-0